  true,\n\t\"url\": null,\n\t\"notes\": \"The Health Services Training Report (HST)
  Database tracks the overall number of Personnel and Accounting Integrated Data Systems
  (PAID) and Without Compensation (WOC) Trainee positions by the cooperating academic
  institutions for all medical center approved health services programs. Information
  in the database comes from all Veterans Affairs Medical Centers (VAMCs) who have
  Office of Academic Affiliations (OAA) approved HST programs. Worksheets and memos
  are distributed to participating VAMCs by the OAA annually. VAMC personnel enter
  the information electronically into the database located at the OAA Support Center
  (OAASC) in St. Louis, Missouri. The main user of this database is the OAA.\",\n\t\"license_title\":
